import { Link } from "react-router-dom"

import Backendless from 'backendless'


//console.log( "--> Aca esta Diego!")


export function Page1() {

    var APP_ID = 'F405D13E-0A77-400C-ACBE-8146E8285936';
    var API_KEY = 'BC70880E-34E2-4992-AB6C-C87592ED3A5B';
    Backendless.initApp(APP_ID, API_KEY);

    
    Backendless.Data.of( "Person" ).findFirst()
        .then( function( result ) {
            var resultString = JSON.stringify(result);
            console.log( "Resultados esperando: " + resultString)
        })
        .catch( function( error ) {
        console.log( "error - " + error.message );
        });
    
    /*
    const result = await Backendless.Data.of('Person').findFirst();
    const resultString = JSON.stringify(result);
    console.log( "Resultados esperando: " + resultString)
    */

    return (
        <>
            <h1>Page1 - Backendless</h1>
            <h1>{resultString}</h1>
            <Link to="/">Home</Link>
        </>
    )
}
